import {View, Text, Image, SafeAreaView, TouchableOpacity} from 'react-native';
import React, {useState} from 'react';
// import SettingsArray from "./molecules/SettingsArray";
import styled from 'react-native-styled-components';
import {moderateScale} from 'react-native-size-matters';
import CustomText from '../../../components/CustomText';
// import MainSettingsArray from "./molecules/MainSettingsArray";
import ToggleSwitch from 'toggle-switch-react-native';
import icons from '../../../../assets/icons';
import {colors} from '../../../utils/Colors';
import {Divider} from 'react-native-elements';
import dynamicLinks from '@react-native-firebase/dynamic-links';
import profileImages from '../../../../assets/Profile_images';
import Share from 'react-native-share';
import base64 from 'react-native-base64';

function GeneralSettings({navigation}) {
  const ShareImages={
    image1:"data:image/jpeg;base64,",
    image2:"data:image/png;base64,"
  }
  const [isOn, setisOn] = useState({
    global: false,
    withProfile: false,
    withSticker: true,
  });

  const generateLink = async () => {
    const id =  (new Date()).getTime();
    try {
      var link = await dynamicLinks().buildShortLink(
        {
          link: `https://getsolemate.page.link/EwdR?screen=profile&id=${id}`,
          domainUriPrefix: 'https://getsolemate.page.link',
          android: {
            packageName: 'com.Solmate',
            minimumVersion: '18',
          },
          ios: {
            appStoreId: '123456789',
            bundleId: 'com.Solmate',
            minimumVersion: '18',
          },
        },
        dynamicLinks.ShortLinkType.DEFAULT,
      );
      return link;
    } catch (error) {
      console.log('error raised', error);
    }
  };

  const shareUser = async () => {
    console.log('imageLink:', base64.encode(''))
   // getting userProfile Link
   const profileLink = await generateLink();
   // console.log('get builtLink:', profileLink);
    const options = {
      url: profileLink,
      // urls: [ShareImages.image2],
      message: 'Wanna Talk! Go to my profile',
    };
    
    // Share
    await Share.open(options)
      .then(res => {
        console.log('Success', res);
      })
      .catch(err => {
        err && console.log('Error', err);
      });
  };

  const toggleSwitch = () => setisOn(previousState => !previousState);

  return (
    <SafeAreaView>
      <Container>
        <TouchableOpacity onPress={() => shareUser()}>
          <View>
            <CustomText
              fontSize={14}
              fontWeight={'700'}
              alignSelf={'flex-end'}
              marginTop={-10}
              color={colors.primary}
              fontFamily={'ProximaNova_Bold'}>
              Done
            </CustomText>
          </View>
        </TouchableOpacity>

        <TouchableOpacity>
          <View>
            <CustomText
              fontSize={22}
              fontWeight={'700'}
              marginBottom={35}
              marginTop={17}
              fontFamily={'ProximaNova_Bold'}>
              Settings
            </CustomText>
          </View>
        </TouchableOpacity>

        <TouchableOpacity>
          <DirectionRow>
            <CustomText
              fontFamily={'ProximaNova_Bold'}
              fontSize={14}
              fontWeight={'700'}
              marginTop={-5}>
              Location
            </CustomText>

            <View style={{width: '91%'}}>
              <CustomText
                fontSize={12}
                color={colors.gray}
                marginLeft={50}
                marginTop={-8}
                fontFamily={'ProximaNova_Regular'}>
                Cecilia Chapman 711-2880 Nulla St. Mankato Mississippi 96522
              </CustomText>
            </View>
          </DirectionRow>
        </TouchableOpacity>
      </Container>
      <Divider />

      <Container>
        <TouchableOpacity>
          <WithSwitch>
            <CustomText
              fontFamily={'ProximaNova_Bold'}
              fontSize={14}
              fontWeight={'700'}
              marginTop={3}>
              Global
            </CustomText>

            <ToggleSwitch
              isOn={isOn.global}
              onColor={colors.primary}
              offColor={colors.switchGray}
              labelStyle={{color: 'black', fontWeight: '900'}}
              size="large"
              onToggle={() => {
                setisOn({...isOn, global: !isOn.global});
              }}
            />
          </WithSwitch>

          <CustomText
            fontFamily={'ProximaNova_Regular'}
            fontSize={11}
            marginTop={10}
            alignSelf={'flex-start'}
            color={colors.gray}>
            The global mode turns on as soon as the profiles in this location
            run out.
          </CustomText>
        </TouchableOpacity>

        <TouchableOpacity>
          <WithSwitch style={{marginTop: 50}}>
            <CustomText
              fontFamily={'ProximaNova_Bold'}
              fontSize={14}
              fontWeight={'700'}
              marginTop={6}>
              Show me with profile
            </CustomText>

            <ToggleSwitch
              isOn={isOn.withProfile}
              onColor={colors.primary}
              offColor={colors.switchGray}
              labelStyle={{color: 'black', fontWeight: '900'}}
              size="large"
              onToggle={() => {
                setisOn({...isOn, withProfile: !isOn.withProfile});
              }}
            />
          </WithSwitch>
        </TouchableOpacity>
      </Container>

      <Divider />

      <Container>
        <TouchableOpacity>
          <WithSwitch>
            <CustomText
              fontFamily={'ProximaNova_Bold'}
              fontSize={14}
              fontWeight={'700'}
              marginTop={6}>
              Show me only with sticker
            </CustomText>

            <ToggleSwitch
              isOn={isOn.withSticker}
              onColor={colors.primary}
              offColor={colors.switchGray}
              labelStyle={{color: 'black', fontWeight: '900'}}
              size="large"
              onToggle={() => {
                setisOn({...isOn, withSticker: !isOn.withSticker});
              }}
            />
          </WithSwitch>
          <CustomText
            fontFamily={'ProximaNova-Regular'}
            fontSize={11}
            marginTop={17}
            alignSelf={'flex-start'}
            color={colors.gray}>
            You can turn off the profile function and only turn on the sticker
            system. All participants will see and find you only by the sticker.
          </CustomText>
        </TouchableOpacity>
      </Container>

      <Divider />
      <Container>
        <TouchableOpacity onPress={() => navigation.navigate('MainSettings')}>
          <WithSwitch>
            <CustomText
              fontFamily={'ProximaNova_Bold'}
              fontSize={14}
              fontWeight={'700'}
              marginTop={5}>
              Profile management
            </CustomText>

            <CustomText
              fontFamily={'ProximaNova_Regular'}
              fontSize={12}
              color={colors.gray}
              marginTop={5}
              marginLeft={80}>
              All Settings
            </CustomText>
            <Image style={{marginTop: 10}} source={icons.rightArrowBlack} />
          </WithSwitch>
        </TouchableOpacity>
      </Container>
      <Divider />
    </SafeAreaView>
  );
}

const Container = styled(View, {
  padding: 20,
});

const DirectionRow = styled(View, {
  flexDirection: 'row',
});

const Underline = styled(View, {
  borderBottomColor: '#eee',
  borderBottomWidth: 2,
  width: moderateScale(380),
});

const WithSwitch = styled(View, {
  justifyContent: 'space-between',
  flexDirection: 'row',
});

export default GeneralSettings;
